INSERT INTO `news` (`id`, `company_id`, `news_category`, `news_heading_en`, `news_heading_el`, `news_content_en`, `news_content_el`, `news_location`, `latitude`, `longitude`, `news_url`, `news_image`, `Author_Name`, `date`, `sorting_order`) VALUES ('1', '1', '1', 'Sardine Festival in Skala Kaloni', 'Φεστιβάλ Σαρδέλας στη Σκάλα Καλώνη', 'The town of Skala Kaloni in the south of Lesvos, in the north east Aegean sea, is famous for being home to some of the best sardines in the whole of Europe. Whether grilled, fried or pastes (fresh sardines that have been caught in the morning, salted on the fisherman’s boat\r\nand served the same night with the local drink of choice ‘ouzo’), they are absolutely delicious. During the first weekend of August, the main square at Skala Kalloni is transformed into an open air eatery, with free ouzo and sardines offered to the visitors.  A live band with traditional dancers adds a local tone to this culinary event.', 'Η πόλη της Σκάλας Καλώνης στα νότια της Λέσβου, στο βορειοανατολικό Αιγαίο, είναι γνωστή για το γεγονός ότι φιλοξενεί μερικές από τις καλύτερες σαρδέλες σε ολόκληρη την Ευρώπη. Είτε ψητό στη σχάρα, τηγανητά ή πάστες (φρέσκες σαρδέλες που έχουν αλιευθεί το πρωί, αλατισμένες στη βάρκα του ψαρά\r\nΚαι σερβίρονται το ίδιο βράδυ με το τοπικό ποτό της επιλογής \'ούζο\'), είναι απολύτως νόστιμα. Κατά το πρώτο σαββατοκύριακο του Αυγούστου, η κεντρική πλατεία της Σκάλας Καλλονής μετατρέπεται σε υπαίθριο εστιατόριο με δωρεάν ουζάκι και σαρδέλες που προσφέρονται στους επισκέπτες. Μια ζωντανή μπάντα με παραδοσιακούς χορευτές προσθέτει ένα τοπικό τόνο σε αυτό το γαστρονομικό γεγονός', 'Lesvos Island', '', '', '', '1495620101_Sardines.jpg', '', '2017-05-23 11:54:14', '0');
INSERT INTO `news` (`id`, `company_id`, `news_category`, `news_heading_en`, `news_heading_el`, `news_content_en`, `news_content_el`, `news_location`, `latitude`, `longitude`, `news_url`, `news_image`, `Author_Name`, `date`, `sorting_order`) VALUES ('2', '1', '1', 'The Mushroom Festival in Grevenà', 'Το Φεστιβάλ Μανιταριών στο Γρεβενά', 'The picturesque villages of Grevenà, in the north of Greece, are the perfect setting for a traditional mushroom festival.  Amidst pristine green woods, Grevenà has rightfully earned its title as “official mushroom capital of the country” and every year, towards the end of the summer, the region becomes a meeting place for mushroom lovers from the four corners of Greece.\r\n\r\nVisitors take part in educational seminars and participate in mushroom exploration tours in the woods.  There is a lot to learn about those hundreds of mushroom species that grow in these soils.  In the festival premises, tourists have the chance to savor various kinds of mushroom delicacies and sweets such as mushroom pickles, mushroom jam, truffles, mushroom liqueur, traditional pasta with mushrooms, mushroom nougat, etc.\r\n\r\nMusic from rock, jazz and latin bands accompany this culinary adventure and for the trekking type, the opportunities to go hiking in the woods are numerous.  For those who wish to spend the night in the area, there is also a camping site.', 'Τα γραφικά χωριά της Γρεβενών, στο βόρειο τμήμα της Ελλάδας, αποτελούν το τέλειο σκηνικό για ένα παραδοσιακό φεστιβάλ μανιταριών. Μέσα από τα παρθένα πράσινα δάση, η Γρεβενά κέρδισε δικαιολογημένα τον τίτλο της ως «επίσημο κεφάλαιο μανιταριών της χώρας» και κάθε χρόνο, προς το τέλος του καλοκαιριού, η περιοχή γίνεται τόπος συνάντησης για τους λάτρεις των μανιταριών από τις τέσσερις γωνιές της Ελλάδας.\r\n\r\nΟι επισκέπτες λαμβάνουν μέρος σε εκπαιδευτικά σεμινάρια και συμμετέχουν σε περιηγήσεις εξερεύνησης μανιταριών στο δάσος. Υπάρχουν πολλά που πρέπει να μάθετε για τις εκατοντάδες είδη μανιταριών που αναπτύσσονται σε αυτά τα εδάφη. Στους χώρους του φεστιβάλ, οι τουρίστες έχουν την ευκαιρία να απολαύσουν διάφορα είδη μαρμελάδων και γλυκών όπως μανιτάρια μανιταριών, μανιτάρια μανιταριών, τρούφες, λικέρ μανιταριών, παραδοσιακά ζυμαρικά με μανιτάρια, μανιτάρια μανιταριών κλπ.\r\n\r\nΜουσική από ροκ, τζαζ και λατινικά συγκροτήματα συνοδεύουν αυτή τη μαγειρική περιπέτεια και για τον πεζοπορικό τύπο, οι δυνατότητες πεζοπορίας στο δάσος είναι πολλές. Για όσους επιθυμούν να περάσουν τη νύχτα στην περιοχή, υπάρχει επίσης κάμπινγκ.', 'Kennett Square, PA 19348, Grevenà, Greece', '', '', '', '1495619781_mushrooms.jpg', '', '2017-05-24 09:56:21', '0');
INSERT INTO `news` (`id`, `company_id`, `news_category`, `news_heading_en`, `news_heading_el`, `news_content_en`, `news_content_el`, `news_location`, `latitude`, `longitude`, `news_url`, `news_image`, `Author_Name`, `date`, `sorting_order`) VALUES ('3', '1', '2', 'Athens street food: A taste of Greece\'s culinary revolution', 'Τρόφιμα δρόμου της Αθήνας: Μια γεύση της μαγειρικής επανάστασης της Ελλάδας', 'When morning coffee is served as thick, dark and potentially brain-exploding as this, we can only be in Athens.\r\n\r\nWe\'re being served this potent, unfiltered concoction, brewed together with sugar in a traditional brass pot over a gas flame, as fortification for a food tour of the Greek capital.\r\nNo other drink, apparently, will do.\r\n\"Tea is for the sick and the infirm,\" says Diana Kantaroglou, a guide with the Alternative Athens tour company (+30 69 51 51 85 89), who\'s leading us around some of the best culinary haunts in Athens.\r\nWhich is why our day begins at Cafe 111 in Monastiraki, the bazaar neighborhood of Athens. (Cafe 111, Ermou 111 & Agiou Filippou, Athens; +30 21 0323 7967)\r\nAnd we\'re in no particular rush to get going.\r\n\"Greeks are heavy coffee drinkers,\" adds Kantaroglou. \"We also like to socialize in cafes unlike, say, the Italians with their quick drink-and-go espresso shots.\"\r\nOnce finished, we turn over the cups and let the residue run down inside; there are still professional coffee readers who will predict your future from the resulting pattern.\r\nNone are present so early in the morning, so we put our fate in Kantaroglou\'s hands and head out.\r\nWe\'re on the trail of some of the best street food in Athens -- a culinary scene that\'s changed rapidly in recent years as Greek economic woes and the recent European migrant crisis have had an unexpectedly delicious impact on the city\'s eating habits.\r\nNaxos -- lush Greek island delivers the good life\r\nSavoring the essence\r\nKantaroglou brings us to the Athens meat and vegetable market where all Greek staples are on show.\r\nThere\'s fruit, olives, dried meats, raisins and nuts of all persuasions: stubby hazelnuts, pistachios in their shells, roasted peanuts, salted almonds, chopped walnuts and more.\r\nBut we have to go elsewhere for the basic ingredient of the Greek diet: olive oil.\r\n\"We\'re the world\'s third top producers of olive oil and its biggest consumers,\" Kantaroglou tells us as we enter Lalades (Lalades, 3 Plateia Agion Anargyron, Athens; +30 21 0325 5407), a Greek deli at Agion Anargyron square. \"We use 18 liters per capita every year.\"\r\nInside the deli, everything is ready for an olive oil tasting as serious as anything encountered in a French winery.\r\nWe dip bread into little oil jars and then chew slowly to savor the essence.\r\nWe all love the extra virgin oil from the Aegion region of the Peloponnese, pressed cold, with its low acidity.\r\nWe\'re also fond of \"agourelaio,\" used for salads and grilled fish, a bitter oil from unripe olives responsible for the aroma of many a Greek holiday island meal.', 'Όταν το πρωινό καφέ σερβίρεται ως παχύ, σκοτεινό και ενδεχομένως εγκεφαλικό που εκρήγνυται όπως αυτό, μπορούμε να είμαστε μόνο στην Αθήνα.\r\n\r\nΜας εξυπηρετεί αυτό το ισχυρό, αδιάλυτο φαγητό, που παρασκευάζεται μαζί με τη ζάχαρη σε ένα παραδοσιακό ορειχάλκινο δοχείο πάνω από μια φλόγα αερίου, ως οχύρωση για μια ξενάγηση στην ελληνική πρωτεύουσα.\r\nΚανένα άλλο ποτό, προφανώς, δεν θα κάνει.\r\n«Ο τσάι είναι για τους άρρωστους και τους άρρωστους», λέει η Ντιάνα Κάνταρογλου, ένας οδηγός με την εταιρεία τουριστικών εταιρειών Alternative Athens (+30 69 51 51 85 89), που μας οδηγεί σε μερικά από τα καλύτερα μαγαζιά στην Αθήνα.\r\nΓι \'αυτό και η μέρα μας ξεκινά από το Cafe 111 στο Μοναστηράκι, τη γειτονιά των παζάρων της Αθήνας. (Cafe 111, Ερμού 111 & Αγίου Φιλίππου, Αθήνα, +30 21 0323 7967)\r\nΚαι δεν βρισκόμαστε σε ιδιαίτερη βιασύνη να προχωρήσουμε.\r\n\"Οι Έλληνες είναι κακοί πότες καφέ\", προσθέτει ο Κανταρόγλου. \"Μας αρέσει επίσης να κοινωνικοποιούμε σε καφενεία σε αντίθεση με, ας πούμε, τους Ιταλούς με τις γρήγορες στιγμές τους espresso\".\r\nΑφού τελειώσετε, γυρίζουμε τα κύπελλα και αφήνουμε τα υπολείμματα να πέσουν μέσα. Εξακολουθούν να υπάρχουν επαγγελματίες αναγνώστες καφέ που θα προβλέψουν το μέλλον σας από το προκύπτον πρότυπο.\r\nΚανείς δεν είναι παρών τόσο νωρίς το πρωί, έτσι βάζουμε τη μοίρα μας στα χέρια του Κανταρόγλου και το κεφάλι έξω.\r\nΒρισκόμαστε στη διαδρομή μερικών από τα καλύτερα τρόφιμα στο δρόμο της Αθήνας - μια μαγειρική σκηνή που άλλαξε ταχέως τα τελευταία χρόνια, καθώς οι ελληνικές οικονομικές δυσκολίες και η πρόσφατη μετανάστευση στην Ευρώπη είχαν απροσδόκητα υπέροχη επίδραση στις διατροφικές συνήθειες της πόλης.\r\nΗ Νάξος - το καταπράσινο νησί της Ελλάδας, προσφέρει την καλή ζωή\r\nΑπολαμβάνοντας την ουσία\r\nΗ Κανταρόγλου μας φέρνει στην αγορά κρέατος και λαχανικών της Αθήνας όπου εκτίθενται όλα τα ελληνικά προϊόντα.\r\nΥπάρχουν φρούτα, ελιές, αποξηραμένα κρέατα, σταφίδες και ξηροί καρποί όλων των πειθών: φουντουκιά, φιστίκια στα κοχύλια τους, ψητά φιστίκια, αλατισμένα αμύγδαλα, ψιλοκομμένα καρύδια και πολλά άλλα.\r\nΑλλά πρέπει να πάμε αλλού για το βασικό συστατικό της ελληνικής διατροφής: το ελαιόλαδο.\r\n«Είμαστε οι τρίτοι κορυφαίοι παραγωγοί ελαιολάδου στον κόσμο και οι μεγαλύτεροι καταναλωτές», μας λέει η Κανταρόγλου καθώς μπαίνουμε στις Λάλαδες (Λαλάδες, 3 Πλατεία Αγίων Αναργύρων, Αθήνα, +30 21 0325 5407), μια ελληνική γιορτή στην πλατεία Αγίων Αναργύρων. \"Χρησιμοποιούμε 18 λίτρα κατά κεφαλή κάθε χρόνο.\"\r\nΜέσα στο deli, όλα είναι έτοιμα για μια δοκιμή ελαιολάδου τόσο σοβαρή όσο οτιδήποτε συναντήθηκε σε ένα γαλλικό οινοποιείο.\r\nΒυθίζουμε το ψωμί σε μικρά βάζα πετρελαίου και στη συνέχεια μασάμε αργά για να απολαύσουμε την ουσία.\r\nΌλοι αγαπάμε το εξαιρετικό παρθένο ελαιόλαδο από την περιοχή του Αιγίου της Πελοποννήσου, πιέζεται το κρύο, με τη χαμηλή του οξύτητα.\r\nΑγαπάμε επίσης το «αγουρέλαιο», το οποίο χρησιμοποιείται για τις σαλάτες και τα ψάρια στη σχάρα, ένα πικρό πετρέλαιο από άγουρες ελιάς που είναι υπεύθυνο για το άρωμα πολλών ελληνικών νησιωτικών γευμάτων.', '328 Vouliagmenis Ave., Agios Dimitrios, Greece', '', '', '', '1495620593_161010150134-traditional-koulouri-super-169.jpg', '', '2017-05-24 10:09:53', '0');
INSERT INTO `news` (`id`, `company_id`, `news_category`, `news_heading_en`, `news_heading_el`, `news_content_en`, `news_content_el`, `news_location`, `latitude`, `longitude`, `news_url`, `news_image`, `Author_Name`, `date`, `sorting_order`) VALUES ('17', '1', '3', 'Lemon Yogurt Cake', 'Λεμόνι Γιαούρτι κέικ', 'Place the oil, eggs, lemon rind, lemon juice, yoghurt and sugar in a large bowl and whisk to combine. Sift over the flour and stir until smooth.', 'Τοποθετήστε το λάδι, τα αυγά, φλούδα λεμονιού, το χυμό λεμονιού, το γιαούρτι και τη ζάχαρη σε ένα μεγάλο μπολ και χτυπήστε ελαφρά για να συνδυάσετε. Ήταν κοσκινίζει πάνω από αλεύρι και ανακατεύουμε μέχρι να γίνει λείο.', 'Greece', '', '', '', '1495809875_lemon_yoghurt_cake.jpg', '', '2017-05-26 14:44:35', '0');
INSERT INTO `news` (`id`, `company_id`, `news_category`, `news_heading_en`, `news_heading_el`, `news_content_en`, `news_content_el`, `news_location`, `latitude`, `longitude`, `news_url`, `news_image`, `Author_Name`, `date`, `sorting_order`) VALUES ('16', '1', '3', 'Fish Curry', 'Ψάρι κάρυ', 'For night\'s when you need something quick, easy and not too heavy but full of flavour – this fish curry is what you should make.', 'Για νύχτα όταν χρειάζεστε κάτι γρήγορο, εύκολο και όχι πάρα πολύ βαρύ, αλλά γεμάτο γεύση - αυτό το κάρυ ψαριού είναι αυτό που πρέπει να κάνετε.', 'Athense', '', '', '', '1495808100_download_(9).jpg', '', '2017-05-26 14:15:00', '0');
