#
# TABLE STRUCTURE FOR: admin
#

DROP TABLE IF EXISTS `admin`;

CREATE TABLE `admin` (
  `id` smallint(6) NOT NULL AUTO_INCREMENT,
  `name` varchar(11) NOT NULL,
  `email` varchar(150) NOT NULL,
  `password` varchar(255) NOT NULL,
  `created_date` datetime NOT NULL,
  `last_login` datetime NOT NULL,
  `last_ip` varchar(150) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: admin_notification
#

DROP TABLE IF EXISTS `admin_notification`;

CREATE TABLE `admin_notification` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `message` text NOT NULL,
  `title` varchar(250) DEFAULT NULL,
  `type_id` int(11) NOT NULL DEFAULT '0',
  `user_ids` text,
  `device_ids` text NOT NULL,
  `notification_type` enum('ADMIN_NOTIFICATION','OFFER','LOYALTY','NEWS','NEWS_DEVICE','OFFER_DEVICE','ADMIN','ADMIN_DEVICE') NOT NULL,
  `status` enum('PENDING','COMPLETED') NOT NULL DEFAULT 'PENDING',
  `added_date` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=29 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: agents
#

DROP TABLE IF EXISTS `agents`;

CREATE TABLE `agents` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `role_id` int(11) NOT NULL,
  `full_name` varchar(100) NOT NULL,
  `email` varchar(100) NOT NULL,
  `phone_number` varchar(100) NOT NULL,
  `password` varchar(255) NOT NULL,
  `gender` enum('MALE','FEMALE') NOT NULL,
  `date_of_birth` date NOT NULL,
  `image` varchar(255) CHARACTER SET utf8 NOT NULL,
  `is_active` smallint(6) NOT NULL COMMENT '0 = No, 1= Yes',
  `create_date` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=24 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: booking
#

DROP TABLE IF EXISTS `booking`;

CREATE TABLE `booking` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL,
  `agent_id` int(11) NOT NULL,
  `full_name` varchar(100) NOT NULL,
  `email` varchar(100) NOT NULL,
  `phone_number` varchar(100) NOT NULL,
  `place` varchar(255) NOT NULL,
  `no_of_persons` varchar(100) NOT NULL,
  `booking_details` text NOT NULL,
  `reservation_date` datetime NOT NULL,
  `status` smallint(6) NOT NULL COMMENT '1= confirmed, 2= pending, 3= cancelled',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=27 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: booking_history
#

DROP TABLE IF EXISTS `booking_history`;

CREATE TABLE `booking_history` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `table_id` int(11) NOT NULL,
  `request_id` int(11) DEFAULT NULL,
  `user_id` int(11) DEFAULT NULL,
  `agent_id` int(11) NOT NULL DEFAULT '0',
  `floor_id` int(11) NOT NULL,
  `booking_date` date NOT NULL,
  `time_from` time NOT NULL,
  `time_to` time NOT NULL,
  `no_of_persons` varchar(255) NOT NULL,
  `mobile` varchar(255) NOT NULL,
  `place` varchar(255) NOT NULL,
  `countries_isd_code` varchar(50) NOT NULL,
  `name` varchar(255) NOT NULL,
  `email` varchar(255) NOT NULL,
  `comment` text NOT NULL,
  `status` smallint(6) NOT NULL COMMENT '1 = Confirm, 2= pending, 3= cancel,4=Arrived,5=No Show',
  `created` datetime NOT NULL,
  `referrer` varchar(150) NOT NULL,
  `special_request_id` text NOT NULL,
  `delete_comment` text,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1307 DEFAULT CHARSET=latin1;

#
# TABLE STRUCTURE FOR: cms
#

DROP TABLE IF EXISTS `cms`;

CREATE TABLE `cms` (
  `cms_id` int(11) NOT NULL AUTO_INCREMENT,
  `page_id` varchar(50) NOT NULL,
  `description_en` text CHARACTER SET utf8 NOT NULL,
  `description_el` text CHARACTER SET utf8 NOT NULL,
  `image` varchar(255) CHARACTER SET utf8 NOT NULL,
  `is_active` smallint(6) NOT NULL COMMENT '1= Yes, 0= No',
  `create_date` datetime NOT NULL,
  PRIMARY KEY (`cms_id`),
  KEY `page_id` (`page_id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: company
#

DROP TABLE IF EXISTS `company`;

CREATE TABLE `company` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `company_name` varchar(100) CHARACTER SET utf8 NOT NULL,
  `company_logo` varchar(255) NOT NULL,
  `company_image` text NOT NULL,
  `ceo_image` varchar(255) NOT NULL,
  `news_event_image` varchar(255) NOT NULL,
  `ceo_message_en` text CHARACTER SET utf8 NOT NULL,
  `ceo_message_el` text CHARACTER SET utf8 NOT NULL,
  `phone_number` varchar(20) NOT NULL,
  `email` varchar(100) NOT NULL,
  `password` varchar(100) NOT NULL,
  `last_login` int(11) NOT NULL,
  `last_ip` varchar(50) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: company_city
#

DROP TABLE IF EXISTS `company_city`;

CREATE TABLE `company_city` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `company_id` int(11) NOT NULL,
  `title_en` varchar(100) CHARACTER SET utf8 NOT NULL,
  `title_el` varchar(100) CHARACTER SET utf8 NOT NULL,
  `description_en` text CHARACTER SET utf8 NOT NULL,
  `description_el` text CHARACTER SET utf8 NOT NULL,
  `company_images` text NOT NULL,
  `site_name_en` varchar(255) CHARACTER SET utf8 NOT NULL,
  `site_name_el` varchar(255) CHARACTER SET utf8 NOT NULL,
  `location_en` varchar(255) CHARACTER SET utf8 NOT NULL,
  `location_el` varchar(255) CHARACTER SET utf8 NOT NULL,
  `latitude` varchar(30) NOT NULL,
  `longitude` varchar(30) NOT NULL,
  `create_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

#
# TABLE STRUCTURE FOR: company_info
#

DROP TABLE IF EXISTS `company_info`;

CREATE TABLE `company_info` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `company_id` int(11) NOT NULL,
  `legal_text_en` text CHARACTER SET utf8 NOT NULL,
  `version` varchar(30) NOT NULL,
  `copyright` varchar(30) NOT NULL,
  `contact_images` text NOT NULL,
  `info_files` text NOT NULL,
  `contact_title_en` varchar(50) NOT NULL,
  `legal_text_el` text CHARACTER SET utf8 NOT NULL,
  `contact_title_el` text CHARACTER SET utf8 NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: contacts
#

DROP TABLE IF EXISTS `contacts`;

CREATE TABLE `contacts` (
  `contact_id` int(11) NOT NULL AUTO_INCREMENT,
  `contact_name` varchar(150) CHARACTER SET utf8 NOT NULL,
  `company_id` int(11) NOT NULL,
  `email_id` varchar(250) NOT NULL,
  `phone_no` varchar(50) NOT NULL,
  `contact_image` varchar(250) NOT NULL,
  `message` text CHARACTER SET utf8 NOT NULL,
  `message_image` varchar(250) NOT NULL,
  `datetime` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`contact_id`),
  UNIQUE KEY `email_id` (`email_id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: contacts_email
#

DROP TABLE IF EXISTS `contacts_email`;

CREATE TABLE `contacts_email` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `company_id` int(11) NOT NULL,
  `email` varchar(50) NOT NULL,
  `subject` varchar(100) CHARACTER SET utf8 NOT NULL,
  `message` text CHARACTER SET utf8 NOT NULL,
  `create_datetime` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

#
# TABLE STRUCTURE FOR: countries
#

DROP TABLE IF EXISTS `countries`;

CREATE TABLE `countries` (
  `countries_id` int(11) NOT NULL AUTO_INCREMENT,
  `countries_name` varchar(64) NOT NULL DEFAULT '',
  `countries_iso_code` varchar(2) NOT NULL,
  `countries_isd_code` varchar(7) DEFAULT NULL,
  PRIMARY KEY (`countries_id`)
) ENGINE=InnoDB AUTO_INCREMENT=250 DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: device
#

DROP TABLE IF EXISTS `device`;

CREATE TABLE `device` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `deviceId` varchar(250) NOT NULL,
  `device_type` enum('IOS','ANDROID') NOT NULL,
  `device_key` varchar(250) NOT NULL COMMENT 'Used to send push notifications',
  `company_id` int(11) NOT NULL,
  `badges` int(5) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

#
# TABLE STRUCTURE FOR: email_cron
#

DROP TABLE IF EXISTS `email_cron`;

CREATE TABLE `email_cron` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `type_id` int(11) NOT NULL,
  `user_id` int(11) NOT NULL,
  `type` varchar(50) NOT NULL,
  `is_sent` tinyint(1) NOT NULL COMMENT '0 = not sent 1 = sent',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=23 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: feedback_of_restaurant
#

DROP TABLE IF EXISTS `feedback_of_restaurant`;

CREATE TABLE `feedback_of_restaurant` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `company_id` int(10) NOT NULL,
  `restaurant_id` int(11) NOT NULL,
  `full_name` varchar(250) CHARACTER SET utf8 NOT NULL,
  `email` varchar(250) CHARACTER SET utf8 NOT NULL,
  `contact` varchar(250) NOT NULL,
  `feedback` longtext CHARACTER SET utf8 NOT NULL,
  `feedback_time` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: groups
#

DROP TABLE IF EXISTS `groups`;

CREATE TABLE `groups` (
  `group_id` int(11) NOT NULL AUTO_INCREMENT,
  `group_name` varchar(255) NOT NULL,
  `users` text NOT NULL,
  `create_date` datetime NOT NULL,
  PRIMARY KEY (`group_id`)
) ENGINE=InnoDB AUTO_INCREMENT=14 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: groups_user
#

DROP TABLE IF EXISTS `groups_user`;

CREATE TABLE `groups_user` (
  `group_user_id` bigint(10) NOT NULL AUTO_INCREMENT,
  `group_id` bigint(10) NOT NULL,
  `user_id` bigint(10) NOT NULL,
  PRIMARY KEY (`group_user_id`),
  KEY `group_id` (`group_id`),
  KEY `user_id` (`user_id`),
  CONSTRAINT `groups_user_ibfk_1` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=74 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: languages
#

DROP TABLE IF EXISTS `languages`;

CREATE TABLE `languages` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `language_code` varchar(50) NOT NULL,
  `language_name` varchar(50) NOT NULL,
  `is_default` tinyint(1) NOT NULL COMMENT '1 = default 0 = normal',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: loyalty
#

DROP TABLE IF EXISTS `loyalty`;

CREATE TABLE `loyalty` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `title_en` varchar(100) CHARACTER SET utf8 NOT NULL,
  `title_el` varchar(100) CHARACTER SET utf8 NOT NULL,
  `description_en` text CHARACTER SET utf8 NOT NULL,
  `description_el` text CHARACTER SET utf8 NOT NULL,
  `qr_code` varchar(255) NOT NULL,
  `qr_image` varchar(255) NOT NULL,
  `no_of_scane` int(11) NOT NULL,
  `start_date` date NOT NULL,
  `end_date` date NOT NULL,
  `is_active` smallint(6) NOT NULL COMMENT '0= No, 1= Yes',
  `create_date` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=18 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: menu_category
#

DROP TABLE IF EXISTS `menu_category`;

CREATE TABLE `menu_category` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `category_name_en` varchar(100) CHARACTER SET utf8 NOT NULL,
  `category_name_el` varchar(100) CHARACTER SET utf8 NOT NULL,
  `image` varchar(100) CHARACTER SET utf8 NOT NULL,
  `is_active` smallint(6) NOT NULL COMMENT '1= Yes, 0= No',
  `create_date` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: menu_subcategory
#

DROP TABLE IF EXISTS `menu_subcategory`;

CREATE TABLE `menu_subcategory` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `menu_category_id` int(11) NOT NULL,
  `subcategory_name_en` varchar(100) CHARACTER SET utf8 NOT NULL,
  `subcategory_name_el` varchar(100) CHARACTER SET utf8 NOT NULL,
  `image` varchar(100) CHARACTER SET utf8 NOT NULL,
  `is_active` smallint(6) NOT NULL COMMENT '1= Yes, 0= No',
  `create_date` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=10 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: menus
#

DROP TABLE IF EXISTS `menus`;

CREATE TABLE `menus` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `restaurant_id` int(11) NOT NULL,
  `menu_category_id` int(11) NOT NULL,
  `menu_subcategory_id` int(11) NOT NULL,
  `menu_name_en` varchar(50) CHARACTER SET utf8 NOT NULL,
  `menu_name_el` varchar(50) CHARACTER SET utf8 NOT NULL,
  `description_en` varchar(255) CHARACTER SET utf8 NOT NULL,
  `description_el` varchar(255) CHARACTER SET utf8 NOT NULL,
  `price` int(11) NOT NULL,
  `image` varchar(255) CHARACTER SET utf8 NOT NULL,
  `stock` enum('INSTOCK','OUT OF STOCK') DEFAULT NULL,
  `create_date` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=10 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: mw_booking
#

DROP TABLE IF EXISTS `mw_booking`;

CREATE TABLE `mw_booking` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `table_id` int(11) NOT NULL,
  `request_id` int(11) DEFAULT NULL,
  `user_id` int(11) DEFAULT NULL,
  `agent_id` int(11) NOT NULL DEFAULT '0',
  `floor_id` int(11) NOT NULL,
  `booking_date` date NOT NULL,
  `time_from` time NOT NULL,
  `time_to` time NOT NULL,
  `no_of_persons` varchar(255) NOT NULL,
  `mobile` varchar(255) NOT NULL,
  `place` varchar(255) NOT NULL,
  `countries_isd_code` varchar(50) NOT NULL,
  `name` varchar(255) NOT NULL,
  `email` varchar(255) NOT NULL,
  `comment` text NOT NULL,
  `status` smallint(6) NOT NULL COMMENT '1 = Confirm, 2= pending, 3= cancel,4=Arrived,5=No Show',
  `created` datetime NOT NULL,
  `referrer` varchar(150) NOT NULL,
  `special_request_id` text NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1415 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: mw_booking_tables
#

DROP TABLE IF EXISTS `mw_booking_tables`;

CREATE TABLE `mw_booking_tables` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `table_id` int(11) NOT NULL,
  `booking_id` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=2135 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: mw_rooms
#

DROP TABLE IF EXISTS `mw_rooms`;

CREATE TABLE `mw_rooms` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) NOT NULL,
  `user_id` int(11) DEFAULT NULL,
  `roomWidth` varchar(255) DEFAULT NULL,
  `roomHeight` varchar(255) DEFAULT NULL,
  `agent` int(11) NOT NULL,
  `image` text NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=13 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: mw_shapes
#

DROP TABLE IF EXISTS `mw_shapes`;

CREATE TABLE `mw_shapes` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `image` varchar(255) DEFAULT NULL,
  `seats` int(11) NOT NULL DEFAULT '2',
  `canrotate` int(11) DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=16 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: mw_tables
#

DROP TABLE IF EXISTS `mw_tables`;

CREATE TABLE `mw_tables` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `type` int(11) NOT NULL,
  `seats` int(11) DEFAULT NULL,
  `priority` int(11) DEFAULT NULL,
  `top` varchar(255) DEFAULT NULL,
  `left` varchar(255) DEFAULT NULL,
  `rotation` varchar(255) DEFAULT NULL,
  `name` varchar(255) DEFAULT NULL,
  `roomId` int(11) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `type` (`type`)
) ENGINE=InnoDB AUTO_INCREMENT=187 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: news
#

DROP TABLE IF EXISTS `news`;

CREATE TABLE `news` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `company_id` int(11) NOT NULL,
  `news_category` int(11) NOT NULL,
  `news_heading_en` text CHARACTER SET utf8 NOT NULL,
  `news_heading_el` varchar(255) CHARACTER SET utf8 NOT NULL,
  `news_content_en` text CHARACTER SET utf8 NOT NULL,
  `news_content_el` text CHARACTER SET utf8 NOT NULL,
  `news_location` text NOT NULL,
  `latitude` varchar(20) NOT NULL,
  `longitude` varchar(20) NOT NULL,
  `news_url` text NOT NULL,
  `news_image` varchar(500) CHARACTER SET utf8 NOT NULL,
  `Author_Name` varchar(50) CHARACTER SET utf8 NOT NULL,
  `date` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `sorting_order` int(10) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=51 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: news_category
#

DROP TABLE IF EXISTS `news_category`;

CREATE TABLE `news_category` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `category_image` varchar(255) CHARACTER SET utf8 NOT NULL,
  `company_id` int(11) NOT NULL,
  `category_name_en` varchar(100) CHARACTER SET utf8 NOT NULL,
  `category_name_el` varchar(100) CHARACTER SET utf8 NOT NULL,
  `language_id` varchar(20) NOT NULL,
  `sorting_order` int(10) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=4 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: news_title_image
#

DROP TABLE IF EXISTS `news_title_image`;

CREATE TABLE `news_title_image` (
  `title_id` int(11) NOT NULL AUTO_INCREMENT,
  `company_id` int(10) NOT NULL,
  `image` varchar(255) CHARACTER SET utf8 NOT NULL,
  PRIMARY KEY (`title_id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: notifications
#

DROP TABLE IF EXISTS `notifications`;

CREATE TABLE `notifications` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL COMMENT 'Notification reveiver',
  `notification_type` tinyint(4) NOT NULL COMMENT '1 for Supervisor 2 for news',
  `message` text NOT NULL,
  `title` varchar(30) NOT NULL,
  `company_id` int(11) NOT NULL,
  `device_id` text NOT NULL,
  `date_created` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `read_status` tinyint(2) NOT NULL DEFAULT '0' COMMENT '1=read 0=unread',
  `is_notified` tinyint(1) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

#
# TABLE STRUCTURE FOR: offer
#

DROP TABLE IF EXISTS `offer`;

CREATE TABLE `offer` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `offer_name_en` varchar(100) CHARACTER SET utf8 NOT NULL,
  `offer_name_el` varchar(100) CHARACTER SET utf8 NOT NULL,
  `restaurant_id` int(11) NOT NULL,
  `from_date` date NOT NULL,
  `to_date` date NOT NULL,
  `no_of_scane` int(11) NOT NULL,
  `description_en` text CHARACTER SET utf8 NOT NULL,
  `description_el` text CHARACTER SET utf8 NOT NULL,
  `offer_code` varchar(20) NOT NULL,
  `qr_image` varchar(255) CHARACTER SET utf8 NOT NULL,
  `company_id` int(11) NOT NULL,
  `discounts_in_percent` int(11) NOT NULL,
  `offer_limit` int(11) NOT NULL,
  `image` varchar(255) CHARACTER SET utf8 NOT NULL,
  `is_active` smallint(6) NOT NULL COMMENT '0=No, 1=Yes',
  `create_date` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=30 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: offer_history
#

DROP TABLE IF EXISTS `offer_history`;

CREATE TABLE `offer_history` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL,
  `offer_id` int(11) NOT NULL,
  `create_datetime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=20 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: restaurant
#

DROP TABLE IF EXISTS `restaurant`;

CREATE TABLE `restaurant` (
  `restaurant_id` int(11) NOT NULL AUTO_INCREMENT,
  `restaurant_name_en` varchar(250) CHARACTER SET utf8 NOT NULL,
  `company_id` int(11) NOT NULL,
  `restaurant_category_id` int(11) NOT NULL,
  `restaurant_address_en` text CHARACTER SET utf8 NOT NULL,
  `restaurant_name_el` varchar(150) CHARACTER SET utf8 NOT NULL,
  `restaurant_address_el` varchar(255) CHARACTER SET utf8 NOT NULL,
  `restaurant_file` text CHARACTER SET utf8 NOT NULL,
  `restaurant_lat` varchar(20) NOT NULL,
  `restaurant_lang` varchar(20) NOT NULL,
  `contact_number` varchar(20) NOT NULL,
  `email` varchar(50) NOT NULL,
  `days` varchar(50) NOT NULL COMMENT '1=Monday upto 5=Friday',
  `open_time` varchar(250) NOT NULL,
  `close_time` varchar(250) NOT NULL,
  `datetime` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`restaurant_id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: restaurant_sent_message
#

DROP TABLE IF EXISTS `restaurant_sent_message`;

CREATE TABLE `restaurant_sent_message` (
  `msg_id` int(11) NOT NULL AUTO_INCREMENT,
  `restaurant_id` int(11) NOT NULL,
  `name` varchar(30) CHARACTER SET utf8 NOT NULL,
  `surname` varchar(30) CHARACTER SET utf8 NOT NULL,
  `email` varchar(50) CHARACTER SET utf8 NOT NULL,
  `phone` varchar(20) NOT NULL,
  `message` text CHARACTER SET utf8 NOT NULL,
  `image` varchar(500) NOT NULL,
  `create_datetime` datetime NOT NULL,
  `sorting_order` int(10) NOT NULL DEFAULT '0',
  PRIMARY KEY (`msg_id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

#
# TABLE STRUCTURE FOR: role
#

DROP TABLE IF EXISTS `role`;

CREATE TABLE `role` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(100) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: special_request
#

DROP TABLE IF EXISTS `special_request`;

CREATE TABLE `special_request` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) NOT NULL,
  `create_date` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: user_login_history
#

DROP TABLE IF EXISTS `user_login_history`;

CREATE TABLE `user_login_history` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL,
  `device_id` varchar(255) NOT NULL,
  `device_key` text NOT NULL,
  `is_login` tinyint(2) NOT NULL DEFAULT '1' COMMENT '1=login 0=logout',
  `datetime` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

#
# TABLE STRUCTURE FOR: user_loyalty
#

DROP TABLE IF EXISTS `user_loyalty`;

CREATE TABLE `user_loyalty` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `loyalty_id` int(10) NOT NULL,
  `user_id` int(10) NOT NULL,
  `loyalty_scane` smallint(6) NOT NULL,
  `user_scane` smallint(6) NOT NULL,
  `status` tinyint(2) NOT NULL COMMENT '1 = progress 2= complete',
  `create_date` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=29 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: user_news
#

DROP TABLE IF EXISTS `user_news`;

CREATE TABLE `user_news` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL,
  `news_id` int(11) NOT NULL,
  `added_date` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=287 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: user_offers
#

DROP TABLE IF EXISTS `user_offers`;

CREATE TABLE `user_offers` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL,
  `offer_id` int(11) NOT NULL,
  `is_used` smallint(6) NOT NULL DEFAULT '0' COMMENT '0 = No, 1 = Yes',
  `added_date` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=202 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: user_scane_history
#

DROP TABLE IF EXISTS `user_scane_history`;

CREATE TABLE `user_scane_history` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_loyalty_id` int(11) NOT NULL,
  `loyalty_id` int(11) NOT NULL,
  `scane_date` int(11) NOT NULL,
  `scane_time` int(11) NOT NULL,
  `create_datetime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=18 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: users
#

DROP TABLE IF EXISTS `users`;

CREATE TABLE `users` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `name` varchar(150) NOT NULL,
  `email` varchar(250) NOT NULL,
  `password` varchar(255) NOT NULL,
  `address` text,
  `phone_number` varchar(50) NOT NULL,
  `country` varchar(100) DEFAULT NULL,
  `age` int(10) unsigned DEFAULT NULL,
  `date_of_birth` date NOT NULL,
  `gender` enum('MALE','FEMALE') DEFAULT NULL,
  `city` varchar(150) DEFAULT NULL,
  `login_session_key` varchar(255) DEFAULT NULL,
  `is_social_signup` smallint(6) NOT NULL COMMENT '0 = NO, 1 = YES',
  `social_type` enum('FACEBOOK','GOOGLE','TWITTER','INSTAGRAM','APP') DEFAULT NULL,
  `social_id` varchar(250) DEFAULT NULL,
  `user_image` text CHARACTER SET utf8,
  `user_image_thumb` text CHARACTER SET utf8 COMMENT '250 * 250',
  `qr_image` varchar(255) CHARACTER SET utf8 NOT NULL,
  `badges` int(10) unsigned NOT NULL DEFAULT '0',
  `user_token` varchar(250) DEFAULT NULL,
  `device_id` text COMMENT '(Device Token)',
  `device_type` enum('ANDROID','IOS') DEFAULT NULL,
  `device_key` text COMMENT 'Used to send push notifications',
  `is_verified` smallint(6) NOT NULL DEFAULT '0' COMMENT '0 = no, 1 = yes',
  `is_blocked` smallint(6) NOT NULL DEFAULT '0' COMMENT '0 = no, 1 = yes',
  `is_deactivated` smallint(6) NOT NULL DEFAULT '0' COMMENT '0 = No, 1 = Yes',
  `is_subscribe` tinyint(1) NOT NULL COMMENT '1=Yes,0=No',
  `created_date` datetime NOT NULL,
  `last_login` datetime DEFAULT NULL,
  `is_login` tinyint(1) NOT NULL COMMENT '1 = login 0= logout',
  `title` varchar(20) DEFAULT NULL,
  `add_member_first_name` varchar(50) DEFAULT NULL,
  `add_member_last_name` varchar(50) DEFAULT NULL,
  `company_name` varchar(100) DEFAULT NULL,
  `nationality` varchar(50) DEFAULT NULL,
  `other_email` varchar(50) DEFAULT NULL,
  `zip_code` smallint(6) NOT NULL,
  `country_code` varchar(20) NOT NULL,
  `country_code_secondary` varchar(20) NOT NULL,
  `phone_number_secondary` varchar(20) NOT NULL,
  `mobile_number_country_code` varchar(10) NOT NULL,
  `mobile_number` varchar(20) NOT NULL,
  `fax_country_code` varchar(20) NOT NULL,
  `fax` varchar(50) NOT NULL,
  `group_name` varchar(50) NOT NULL,
  `reference` varchar(100) NOT NULL,
  `suppliers` varchar(50) NOT NULL,
  `hoteliers` varchar(50) NOT NULL,
  `concierge` varchar(50) NOT NULL,
  `points` varchar(50) NOT NULL,
  `notes` varchar(255) NOT NULL,
  `name_day` varchar(100) NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `email` (`email`),
  KEY `id` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1500 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: users_device_history
#

DROP TABLE IF EXISTS `users_device_history`;

CREATE TABLE `users_device_history` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `device_id` text NOT NULL,
  `device_type` enum('ANDROID','IOS') NOT NULL,
  `device_key` text NOT NULL COMMENT 'Used to send push notifications',
  `device_badges` int(10) unsigned NOT NULL DEFAULT '0',
  `added_date` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=43 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: users_notifications
#

DROP TABLE IF EXISTS `users_notifications`;

CREATE TABLE `users_notifications` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `type_id` int(11) NOT NULL,
  `notification_parent_id` int(11) NOT NULL DEFAULT '0',
  `sender_id` int(11) NOT NULL,
  `reciever_id` int(11) NOT NULL,
  `device_reciever_id` int(11) NOT NULL DEFAULT '0',
  `notification_type` varchar(50) NOT NULL,
  `title` varchar(150) NOT NULL,
  `message_en` text,
  `message_el` text CHARACTER SET utf8,
  `is_read` smallint(6) NOT NULL COMMENT '0 = No, 1 = Yes',
  `sent_time` datetime NOT NULL,
  `params` text,
  `is_send` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0=Not sent 1= sent',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=279 DEFAULT CHARSET=latin1;



